import React from 'react';
import { useParams } from 'react-router-dom';
import { useState, useEffect } from 'react';
import { fetchOneParts } from '../../../http/partAPI';
import styles from './AvailabilityStore.module.css'

const AvailabilityStore = () => {
    const [part, setPart] = useState({})
    const {id} = useParams()
    
    useEffect(() => {
        fetchOneParts(id).then(data => setPart(data))
        
    }, [])
    
    return (
        <div className={styles.availabilityStore__container} >
            <span className={styles.availabilityStore__row}>Диксона, 1 : {part.diksona}</span>
            <span>Ладо Кецховели 54 : {part.lado}</span>
            <span>Семафорная 261a/2: {part.semaf}</span>
            <span>Калинина 79/1: {part.kalinina}</span>
        </div>
    );
};

export default AvailabilityStore;
